var picList = [revolver, opera, grad, divine, maad, white, queen, mac, wall];
var set = new Set();
set.add(white);
set.add(queen);
set.add(mac);
set.add(wall);
document.querySelectorAll(".vid").forEach((e) => {
    e.addEventListener("mouseover", () => {
        var index = Math.floor(Math.random() * picList.length);
        while (set.has(picList[index])) {
            index = Math.floor(Math.random() * picList.length);

        }
        set.delete(e.src);
        set.add(picList[index]);
        e.src = picList[index];
    });
});